import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "../css/NewsNavbar.css";

const NavCategoryLink = ({ to, category }) => {
  const navigate = useNavigate();

  const handleNavLinkClick = () => {
    navigate(`/news/${category}`);
  };

  return (
    <li>
      <Link to={to} onClick={handleNavLinkClick}>
        <div>
          <span className="navline">{category}</span>
          <div className="nav-line"></div>
        </div>
      </Link>
    </li>
  );
};

const NewsNavbar = () => {
  return (
    <>
      <div className="newsheader">
        <span className="newsTitle">N E W S</span>
        <ul className="listElements">
          <li>
            <Link to="/news/home">
              <div>
                <span className="navline">Home</span>
                <div className="nav-line"></div>
              </div>
            </Link>
          </li>
          <NavCategoryLink to="/news/Science" category="Science" />
          <NavCategoryLink to="/news/Sport" category="Sport" />
          <NavCategoryLink to="/news/Business" category="Business" />
          <NavCategoryLink to="/news/Entertainment" category="Entertainment" />
          <NavCategoryLink to="/news/Culture" category="Culture" />
        </ul>
      </div>
    </>
  );
};

export default NewsNavbar;
